    true,nt"url": null,nt"notes": "ML1RADT is the EOS Aura Microwave Limb Sounder
    (MLS) product containing the level 1 radiances from the filter banks for the THz
    radiometer. The current version is 4.2. Data coverage is continuous August 8, 2004
    to December 12, 2009 when the THz radiometer was placed in standby mode. After this
    date THz data were collected for about 30 days in August/September of 2011, 2012,
    2013 and 2014. Spatial coverage is near-global (-82 deg. to +82 deg. latitude),
    files contain a full days worth of data (15 orbits). Users of the ML1RADT data product
    should read the 'A Short Guide to the Use and Interpretation of v4 Level 1 Data'
    for additional information (http://mls.jpl.nasa.gov/data/Level_1_ReadMe_v4.pdf).nn
         Users are encouraged to register with the MLS science team at https://mls.jpl.nasa.gov/forms/reguser.php
    to obtain updates and information about this data product.nn      The data are stored
    in the version 5 Hierarchical Data Format, or HDF5. Each file contains sets of HDF5
    dataset objects (n-dimensional arrays) for each measurement. The dataset objects
    represent data and geolocation fields; included in the file are file attributes
    and metadata. There is one file per day.",nt"license_title": "U.S. Government
